<?php namespace vanhenry\events_jb;class EventListener{    public function subscribe($events){        $events->listen('vanhenry.manager.insert.success', InsertSuccess::class);        // $events->listen('vanhenry.manager.insert.preinsert', PreInsert::class);        $events->listen('vanhenry.manager.insert.generate_view', GenerateView::class);        $events->listen('vanhenry.manager.delete.success', DeleteSuccess::class);        $events->listen('vanhenry.manager.delete.predelete', PreDelete::class);    }}